function substrCount(n, s) {
  s = EXAMPLE_INPUT;
  n = s.length;
  let array = [];
  let subsCount = 0;
  let start = 0;
  for (let i = 0; i < n; i++) {
    let ch = s[i];
    // console.log(ch);
    let count = {};
    count[ch] = 1;

    for (let j = i + 1; j <= n; j++) {
      i = j - 1;
      if (s[i] != s[j]) {
        break;
      } else {
        count[ch] = count[ch] + 1;
      }
    }
    array.push(count);
    if (count[ch] == s.length) {
      break;
    }
  }
  //   let substrings = getAllSubstrings(s, n);
  //   return substrings.length;
  console.log(array);
  for (let i = 0; i < array.length; i++) {
    let currentObj = array[i];
    let count = Object.values(currentObj)[0];
    subsCount += (count * (count + 1)) / 2; //sum of n numbers
  }
  let secondCount = 0;
  for (let i = 1; i < s.length; i++) {
    let check = 1;
    let str = s[i - check];
    if (s[i - check] == s[i] || s[i + check] == s[i]) {
      continue;
    }
    while (
      i - check > -1 &&
      i + check < s.length &&
      s[i - check] == str &&
      s[i + check] == str
    ) {
      // console.log(str, s[i - check]);
      secondCount = secondCount + 1;
      // console.log(secondCount);
      check++;
    }
  }
  console.log(subsCount, secondCount);
  console.log(subsCount + secondCount);
}
